    // const [additem, setAddItem] = useState([])

    const addNote = () => {
        alert("i m clicked")
    }


  return (
    <>
        <Header/>
        <CreateNote  passNote={addNote}/>
        <Note/>
        <Footer/>
    </>
  )
}

export default App
